import React from 'react'

function InterestItem(props) {
    return (
        <>
        <li className="interests__item">
            <a className ="interests__item__link" target="interests__item__link" href={props.url}>
                <figure class="interests__item__pic-wrap" data-category={props.label}>
                    <img src={props.src}
                     alt="" class="interests__item__img"/>
                </figure>
                <div className='interests__item__info'>
                    <h5 className="interests__item__text">{props.text}</h5>
                    <h17 className="interests__item__text1">{props.description}</h17>
                </div>
            </a>
        </li>  
        </>
    )
}

export default InterestItem;
